package models_test

import (
	"ClubTennis/models"
	"crypto/md5"
	"encoding/hex"
	"log"
	"testing"

	"github.com/stretchr/testify/assert"
	"github.com/stretchr/testify/require"
)

func TestNotValidHTML(t *testing.T) {
	data := string("Lets get freaky <script>explode()</script>")

	ann := models.NewAnnouncement(data, "")
	require.Nil(t, ann)
}

func TestLongValidHTML(t *testing.T) {
	data := string(`<p>Hello world</p><p>heres a cool picture</p><p><img src="data:image/png;base64," alt=""></p><p>I hope you like it</p>`)

	ann := models.NewAnnouncement(data, "")
	require.NotNil(t, ann)
}

func TestStrip(t *testing.T) {
	data := string(`<p>Hello world</p><p>heres a cool picture</p><p><img src="data:image/png;base64," alt=""></p><p>I hope you like it</p>`)

	ann := models.NewAnnouncement(data, "")
	images, err := models.StripImages(&ann.Data, "http://localhost:8080")
	assert.NoError(t, err)
	assert.Len(t, images, 1)
	assert.Contains(t, ann.Data, "localhost:8080")

	hash := md5.Sum(images[0].Data)
	hexName := hex.EncodeToString(hash[:])
	assert.Contains(t, ann.Data, hexName)
	log.Print(ann.Data)
}
